import React from "react";
import {Button, Container} from 'react-bootstrap';

export default class Home extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            }
        this.bind();
        };
    bind() {
        this.redirectFromWhats = this.redirectFromWhats.bind(this);
    }

    redirectFromWhats(){
        return window.open("https://api.whatsapp.com/send/?phone=5511948816521&text&type=phone_number&app_absent=0")
    }

    render() {
        return (
        <>
            <Container>
                {/*<img></img>*/}
                <Button onClick={() => this.redirectFromWhats()}>
                    <i className="fa fa-pencil-alt icon-white cursor-pointer mx-2 my-2"/>
                    Agendar consulta
                </Button>
            </Container>
        </>
        )
    }
}
